import React, { useEffect } from "react";

export default function HomePage(props) {

  console.log(props.user);

  return (
    <div>
      {props.user !== undefined && props.user.permissions.includes("edit_users") ? (
        <div>
          <p>User ID: {props.user.id}</p>
          <p>User Name: {props.user.name}</p>
          <div>
            Permissions:
            {props.user.permissions.map((permission, index) => (
              <div key={index}>{permission}</div>
            ))}
          </div>
          <p>AccessToken: {props.user.accessToken}</p>
          <p>RefreshToken: {props.user.refreshToken}</p>
        </div>
      ) : (
        <div>
          No user available.
        </div>
      )}
    </div>
  );
}
